import React from 'react'

const EmployeeList = () => {
  return (
    <>
       <Card title={title} >
            <UserTable
                users={users}
                roles={roles}
                roleNames={roleNames}
                getUsers={getUsers}
                openUserForm={(user)=>openUserForm("edit",user)}
                handleCancel={handleCancel}
            />
         </Card>
           <Modal
                visible={visible}
                // title="Create new role"
                title={(target==="create")?"Create new role":"Update role" }
                onCancel={handleCancel}
                footer={null}
            >
                <UserForm
                    handleCancel={handleCancel}
                    // users={users}
                    getUsers={getUsers}
                    user={user}
                    roles={roles}
                    roleNames={roleNames}
                    visible={visible}
                    // target={target}
                />    
            </Modal>
    </>
  )
}
export default EmployeeList
